css:
atom-text-editor,
:host {
  background-color: #282828;
  color: rgba(245, 235, 198, 0.8);
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #282828;
  color: rgba(253, 244, 193, 0.67);
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #3c3836;
  color: rgba(253, 244, 193, 0.67);
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: rgba(253, 244, 193, 0.67);
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  color: #fabd2f;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #fabd2f;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #444444;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: #fabd2f;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: rgba(253, 244, 193, 0.67);
}
atom-text-editor.is-focused .cursor,
:host(.is-focused) .cursor {
  border-color: #fcf9e3;
}
atom-text-editor.is-focused .selection .region,
:host(.is-focused) .selection .region {
  background-color: #504945;
}
atom-text-editor.is-focused .line-number.cursor-line-no-selection,
atom-text-editor.is-focused .line.cursor-line,
:host(.is-focused) .line-number.cursor-line-no-selection,
:host(.is-focused) .line.cursor-line {
  background-color: #3c3836;
}
.list-group li:not(.list-nested-item).status-modified,
.list-tree li:not(.list-nested-item).status-modified,
.list-group li.list-nested-item.status-modified > .list-item,
.list-tree li.list-nested-item.status-modified {
  color: #ffbb1e;
}
.punctuation.definition.tag {
  color: #83a598;
}
.punctuation.definition.entity {
  color: #d3869b;
}
.constant {
  color: #d3869b;
}
.entity {
  color: #8ec07c;
}
.keyword.operator.comparison,
.keyword.operator,
.keyword.operator.symbolic,
.keyword.operator.string,
.keyword.operator.assignment,
.keyword.operator.arithmetic,
.keyword.operator.class,
.keyword.operator.key,
.keyword.operator.logical {
  color: #fe8019;
}
.keyword,
.keyword.operator.new,
.keyword.other,
.keyword.control {
  color: #fa5c4b;
}
.storage {
  color: #fa5c4b;
}
.string:not(.string.unquoted.old-plist:not(.string.unquoted.heredoc)),
.string.unquoted.heredoc .string,
.string .constant.character.escape {
  color: #6ce75e;
}
.string.quoted.double.html .invalid.illegal.bad-ampersand.html {
  color: #6ce75e;
}
.comment {
  font-style: italic;
  color: #928C86;
}
.string.regexp .constant.character.escape {
  color: #6ce75e;
}
.support {
  color: #fabd2f;
}
.misc {
  color: #fdf3bf;
}
.variable {
  color: ##61ff93;
}
.variable.language {
  color: #fdf4c1;
}
.meta.function-call {
  color: #fdf4c1;
}
.invalid {
  color: #fdf4c1;
  background-color: #932b1e;
}
.text .source,
.string.unquoted.heredoc,
.source .source {
  color: #5ff546;
}
.string.quoted .source {
  color: #6ce75e;
}
.string {
  color: #6ce75e;
}
.support.constant {
  color: #fabd2f;
}
.support.class {
  color: #8ec07c;
}
.support.function.misc.postcss {
  color: #ffeeb9;
}
.constant.other.color.rgb-value {
  color: #83a598;
}
.constant.other.color.rgb-value .punctuation.definition {
  color: inherit;
}
.meta.selector.css .entity.name.tag {
  color: #fa5c4b;
}
.entity.name.tag {
  color: #fa5c4b;
}
.entity.name.tag.html {
  color: #8ec07c;
}
.meta.selector.css,
.entity.other.attribute-name.id {
  color: #6ce75e;
}
.meta.selector.css .entity.other.attribute-name.class {
  color: #6ce75e;
}
.entity.other.attribute-name.placeholder.scss {
  color: #d5859b;
}
.entity.other.attribute-name.placeholder.scss .punctuation.definition.entity.scss {
  color: inherit;
}
.support.type.property-name.css,
.support.type.property-name.sass,
.support.type.property-name.scss,
.support.type.property-name.postcss {
  color: #8ec07c;
}
.meta.preprocessor.at-rule .keyword.control.at-rule {
  color: #fabd2f;
}
.meta.property-value .constant {
  color: #fabd2f;
}
.meta.property-value .support.constant.named-color.css {
  color: #fe8019;
}
.meta.constructor.argument.css {
  color: #fabd2f;
}
.meta.diff,
.meta.diff.header {
  color: #fdf4c1;
  background-color: #83a598;
}
.markup.deleted {
  color: #fdf4c1;
  background-color: #fa5c4b;
}
.markup.changed {
  color: #fdf4c1;
  background-color: #fabd2f;
}
.markup.inserted {
  color: #fdf4c1;
  background-color: #8ec07c;
}
.markup.bold {
  font-weight: bold;
}
.markup.italic {
  font-style: italic;
}
.markup.heading {
  font-weight: bold;
  color: #8ec07c;
}
.entity.name.type.class.php {
  color: #8ec07c;
}
.keyword.other.phpdoc {
  color: #928374;
}
.constant.numeric.css,
.keyword.other.unit.css {
  color: #d3869b;
}
.punctuation.definition.entity.css,
.punctuation.definition.entity.scss {
  color: inherit;
}
.variable.language.js {
  color: #fabd2f;
}
.storage.type.dired.item.directory,
.dired.item.directory {
  color: #8ec07c;
}
.entity.name.tag.block.any.html,
.meta.tag.inline.any.html,
.entity.name.tag.inline.any.html,
.meta.tag.block.any.html {
  color: #8ec07c;
}
.entity.other.attribute-name.html {
  color: #6fa598;
}
.constant.character.entity.html,
.punctuation.definition.entity.html {
  color: #d5859b;
}
.string.quoted.double.html {
  color: #6ce75e;
}
.entity.other.attribute-name.attribute.scss {
  color: #CC6666;
}
atom-text-editor .gutter .line-number.linter-warning .icon-right:before,
:host .gutter .line-number.linter-warning .icon-right:before {
  color: #e9c062;
}
atom-text-editor .gutter .line-number.linter-error .icon-right:before,
:host .gutter .line-number.linter-error .icon-right:before {
  color: #cc6666;
}
atom-text-editor .highlights .linter-warning .region,
:host .highlights .linter-warning .region {
  border: 1px solid #e9c062;
  background-image: none;
  background-color: rgba(255, 201, 76, 0.2);
}
atom-text-editor .highlights .linter-error .region,
:host .highlights .linter-error .region {
  border: 1px solid #cc6666;
  background-image: none;
  background-color: rgba(255, 51, 51, 0.2);
}
.bracket-matcher .region {
  border: 1px solid rgba(222, 149, 54, 0.4);
  border-radius: 3px;
  background-color: rgba(255, 217, 0, 0.2);
  z-index: 100;
}
